Neighbor Affair - Courtney Cummz 

Release Date: March 23, 2011

Courtney asks her neighbor Billy to come over to give her some advice about her troubled boyfriend: he's been indicted on 98 counts of mortgage fraud, and he's now on the run. Billy tells her to not answer any of her boyfriend's calls, texts or emails, and to move on from him emotionally and mentally. Courtney's scared, but Billy tells her that he's there to comfort her ... in more ways than one. While Courtney's boyfriend is facing time in the slammer for foreclosure, Billy's foreclosing on her wet pussy with his big dick.
